import React from 'react';

const Logo = () => {
    let imgURL = "https://raw.githubusercontent.com/PokeAPI/media/master/logo/pokeapi_256.png";
    return (
    <nav>
        <img src={imgURL} alt="pokeapi-logo" />
    </nav>
    )
};

export default Logo;
